import products from './products.dummy'
const cart = [
    {
        product: [products[0],products[1],products[2]],
        totalPrice: 0,
        totalQuantity: 0,
    },
    {
        product: [],
        totalPrice: 0,
        totalQuantity: 0,
    }
]

export default cart
